#include <iostream>
#include <vector>
#include <string>
#include <queue>
#include <algorithm>
#include <unordered_set>
#define MAXSTRSIZE 20
#define uint unsigned int
using namespace std;
int dx[8] = {1,1,0,-1,-1,-1,0,1};
int dy[8] = {0,1,1,1,0,-1,-1,-1};
struct Trie {
	bool isEnd;
	Trie* next[26];
	Trie() {
		isEnd = false;
		fill(next, next + 26, nullptr);
	}
	~Trie() {
		for (int i = 0; i < 26; i++) if (next[i]) delete next[i];
	}
	void insert(const char* key) {
		if (*key == '\0') {
			isEnd = true;
			return;
		}
		int curr = *key - 'A';
		if (!next[curr]) next[curr] = new Trie;
		next[curr]->insert(key + 1);
	}
	int find(const char* key) {
		if (*key == '\0') {
			if (isEnd) return 1;
			return 0;
		}
		int curr = *key - 'A';
		if (next[curr]) return next[curr]->find(key + 1);
		else return -1;
	}
};
struct puzzleStr {
	int x;
	int y;
	string str;
	uint mask;
};
Trie* root = new Trie;
vector <vector<char> > puzzle;
unordered_set <string> set;
void makeDictionary();
void input() {
	ios_base::sync_with_stdio(false);
	cin.tie(NULL);
	cout.tie(NULL);
	puzzle.resize(5); for (auto& puz : puzzle) puz.resize(5);
	for (int i = 0; i < 5; i++)
		for (int j = 0; j < 5; j++)
			cin >> puzzle[i][j];	
}
bool inner(int x, int y) {
	return (0 <= x && x < 5 && 0 <= y && y < 5);
}
void puzzling() {
	queue <puzzleStr> q;

	for (int y = 0; y < 5; y++) {
		for (int x = 0; x < 5; x++) {
			string initStr;
			initStr += puzzle[y][x];
			uint mask = (1 << ((5 * y) + x));
			q.push({ x,y, initStr, mask});
			while (!q.empty()) {
				puzzleStr now = q.front(); q.pop();
				if (root->find(now.str.c_str()) == -1) continue;
				if (now.str.length() == MAXSTRSIZE) continue;
				//if (set.find(now.str) != set.end()) continue;
				//set.insert(now.str);
				for (int i = 0; i < 8; i++) {
					if (!inner(now.x + dx[i], now.y + dy[i])) continue;
					if (now.mask & (1 << (5 * (now.y + dy[i]) + now.x + dx[i]))) continue;
					uint newMask = now.mask | (1<< (5 * (now.y + dy[i]) + now.x + dx[i]));
					puzzleStr next = { now.x + dx[i], now.y + dy[i], now.str + puzzle[now.y + dy[i]][now.x + dx[i]], newMask };
					//if (set.find(next.str) != set.end()) continue;
					
					int res = root->find(next.str.c_str());
					//cout << next.str << "=>" << res << '\n';
					if (res == -1) continue;
					else if (res == 1) {
						set.insert(next.str);
						q.push(next);
					}
					else if (res == 0) {
						q.push(next);
					}
				}
			}
		}
	}
	
	

}
int main() {
	makeDictionary();
	input();
	puzzling();
	cout << set.size();
}

